import React from 'react';
import './header.scss'


const Header = () => {
      return (
            <div className='wrapper'>
                  <header className='header'>
                        <div className='container'>
                              <ul className='header_nav'>
                                    <li className='header_nav-list'>Привет</li>
                                    <li className='header_nav-list'>информация</li>
                                    <li className='header_nav-list'>регестрация</li>
                                    <li className='header_nav-list'>о нас</li>
                              </ul>
                        </div>


                  </header>
            </div>

      );
}

export default Header;
